// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "hardhat/console.sol";

contract ConcertTicketContract {
    struct Concert {
        //Create By Who
        string gmail;
        uint256 concertId;
        string name;
        uint256 date;
        string venue;
        uint256 totalTickets;
        uint256 ticketsSold;
        uint256 numZones;
        mapping(uint256 => Zone) zones;
    }

    struct Zone {
        uint256 zoneId;
        string name;
        uint256 totalSeats;
        uint256 seatsSold;
        uint256 ticketPrice;
        mapping(uint256 => bool) seatAvailability;
    }

    //mapping(address => bool) public admins;
    //mapping(address => bool) public concertOrganizers;
    mapping(uint256 => Concert) public concerts;
    //string = Unique ID
    mapping(string => mapping(uint256 => mapping(uint256 => uint256)))
        public userTickets;

    event ConcertCreated(
        string organizer,
        uint256 concertId,
        string name,
        uint256 date,
        string venue
    );

    event TicketPurchased(string uniqueId, uint256 concertId, uint256 zoneId);

    event TicketTransferred(
        string from,
        string to,
        uint256 concertId,
        uint256 ticketId
    );

    function createConcert(
        string memory gmail,
        uint256 concertId,
        string memory name,
        uint256 date,
        string memory venue,
        //uint256 totalTickets,
        uint256 numZones
    ) public {
        Concert storage concert = concerts[concertId];
        concert.gmail = gmail;
        concert.concertId = concertId;
        concert.name = name;
        concert.date = date;
        concert.venue = venue;
        concert.totalTickets = 0;
        concert.ticketsSold = 0;
        concert.numZones = numZones;

        emit ConcertCreated(gmail, concertId, name, date, venue);
    }

    function createZone(
        uint256 concertId,
        uint256 zoneId,
        string memory name,
        uint256 totalSeats,
        uint256 ticketPrice
    ) public {
        Concert storage concert = concerts[concertId];
        require(zoneId < concert.numZones, "Invalid zone ID");

        Zone storage zone = concert.zones[zoneId];
        zone.zoneId = zoneId;
        zone.name = name;
        zone.totalSeats = totalSeats;
        zone.ticketPrice = ticketPrice;
    }

    function purchaseTicket(
        string memory uniqueId,
        uint256 concertId,
        uint256 zoneId
    ) public payable {
        Concert storage concert = concerts[concertId];
        Zone storage zone = concert.zones[zoneId];
        require(zone.seatsSold < zone.totalSeats, "Zone is sold out");
        // require(
        //     userTickets[msg.sender][concertId][zoneId] == 0,
        //     "Customer already has a ticket for this concert"
        // );

        concert.ticketsSold++;
        zone.seatsSold++;
        uint256 ticketId = zone.seatsSold;
        zone.seatAvailability[ticketId] = true;
        userTickets[uniqueId][concertId][zoneId] = ticketId;
        console.log(msg.value);

        emit TicketPurchased( uniqueId, concertId, ticketId);
    }

    function transferTicket(
        string memory uniqueId,
        uint256 concertId,
        uint256 zoneId,
        string memory to,
        uint256 ticketId
    ) public {
        require(
            userTickets[uniqueId][concertId][zoneId] == ticketId,
            "You don't own this ticket"
        );

        userTickets[uniqueId][concertId][zoneId] = 0;
        userTickets[to][concertId][zoneId] = ticketId;

        emit TicketTransferred(uniqueId, to, concertId, zoneId);
    }

    function getConcertDetails(uint256 concertId)
        public
        view
        returns (
            string memory name,
            uint256 date,
            string memory venue,
            uint256 totalTickets,
            uint256 ticketsSold
        )
    {
        Concert storage concert = concerts[concertId];
        return (
            concert.name,
            concert.date,
            concert.venue,
            concert.totalTickets,
            concert.ticketsSold
        );
    }

    function getZoneDetails(uint256 concertId, uint256 zoneId)
        public
        view
        returns (
            string memory name,
            uint256 totalSeats,
            uint256 seatsSold
        )
    {
        Zone storage zone = concerts[concertId].zones[zoneId];
        return (zone.name, zone.totalSeats, zone.seatsSold);
    }
}

